const analyticsPlugin: MeowzerPlugin = {
  name: 'analytics',
  version: '1.0.0',

  install(ctx) {
    // Track cat creations
    ctx.hooks.on('afterCreate', ({ cat }) => {
      analytics.track('cat_created', { id: cat.id });
    });

    // Track saves
    ctx.hooks.on('afterSave', ({ cat }) => {
      analytics.track('cat_saved', { id: cat.id });
    });
  }
};

meowzer.use(analyticsPlugin);
```

